    setAnimalData({
      species: 'собака',
      type: 'вид животного',
      gender: 'самец',
      age: 0,
      condition: 5,
      name: '',
      breed: '',
      status: 'кастрированный',
      activity: 'нормальная активность',
      owner: '',
      currentWeight: 0,
      targetWeight: 0,
      adultWeight: 0,
      lactationWeeks: 0,
      contact: '',
      meCoefficient: 1.0
    });
    setDiagnosis('');
    setIntolerances('');
  };

