                value={animalData.name}
                onChange={(e) => handleInputChange('name', e.target.value)}
                style={{
                  width: '100%',
                  padding: '10px',
                  border: '2px solid #FFB6B6',
                  borderRadius: '8px',
                  fontSize: '14px'
                }}
                placeholder="кличка"
              />
