          background: 'rgba(255, 255, 255, 0.8)',
          padding: '20px',
          borderRadius: '15px',
          border: '2px solid rgba(0, 200, 81, 0.1)'
        }}>
          <div style={{ marginBottom: '20px' }}>
            <h3 style={{ color: '#2d3748', marginBottom: '15px' }}>Вес</h3>
            <div style={{ display: 'grid', gap: '10px' }}>
              <div>
                <input
                  type="number"
                  step="0.1"
